Storyline:

     Dave Saunders and his sidekick Chito, cowhands looking for work, arrive in Sundown Valley, Wyoming just in time to stop sheep ranch foreman Jess Rawlins from lynching cattleman Tug Caldwell. Rawlins seems set on starting a range war.



